import yellowBlock from "./cubeAssets/yellow_block.png";

export default class Block extends React.Component {
  state = { colourNum: -1 };

  constructor(props) {
    super(props);
    this.state.colourNum = props.colour;
  }

  render() {
    var colour;

    console.log(this.state.colourNum);
